const action = {
  updateValue: (data) => {
    return {
      type: "updateValue",
      payload: data,
    };
  },
  uploadImage: (data) => {
    return {
      type: "uploadImage",
      payload: data,
    };
  },
  getUserInfo:(data)
};

export default action;
